BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "ESTADOREGION" (
	"CODPAIS"	INTEGER NOT NULL,
	"CODREGION"	INTEGER NOT NULL,
	"REGION"	TEXT NOT NULL,
	PRIMARY KEY("CODPAIS","CODREGION")
);
CREATE TABLE IF NOT EXISTS "COMUNA" (
	"CODPAIS"	INTEGER NOT NULL,
	"CODREGION"	INTEGER NOT NULL,
	"CODCOMU"	INTEGER NOT NULL,
	"COMUNA"	TEXT NOT NULL,
	PRIMARY KEY("CODPAIS","CODREGION","CODCOMU")
);
CREATE TABLE IF NOT EXISTS "CIUDAD" (
	"PAIS"	INTEGER NOT NULL,
	"REGION"	INTEGER NOT NULL,
	"COMUNA"	INTEGER NOT NULL,
	"CODCIUDAD"	INTEGER NOT NULL,
	"CIUDAD"	TEXT NOT NULL,
	PRIMARY KEY("PAIS","REGION","COMUNA","CODCIUDAD")
);
CREATE TABLE IF NOT EXISTS "PAIS" (
	"CODPAIS"	INTEGER NOT NULL,
	"PAIS"	TEXT NOT NULL,
	PRIMARY KEY("CODPAIS")
);
CREATE TABLE IF NOT EXISTS "EMPRESA" (
	"RUTID"	TEXT NOT NULL,
	"DIGVER"	TEXT NOT NULL DEFAULT 0,
	"NOMBRE"	TEXT,
	"ACTIVIDAD1"	TEXT,
	"ACTIVIDAD2"	TEXT,
	"REPRESENTANTE1"	TEXT,
	"REPRESENTANTE2"	TEXT,
	"REPRESENTANTE3"	TEXT,
	"DOMICILIO1"	TEXT,
	"DOMICILIO2"	TEXT,
	"NUMERO"	TEXT,
	"PISO"	TEXT,
	"OFICINA"	TEXT,
	"CIUDAD"	TEXT,
	"COMUNA"	TEXT,
