CREATE TABLE IF NOT EXISTS "PERSONAL" (
	"RUTID"	TEXT,
	"DIGVER"	TEXT,
	"APELLIDOS"	TEXT,
	"NOMBRES"	TEXT,
	"TELEFONO1"	TEXT,
	"TELEFONO2"	TEXT,
	"CARGO"	TEXT,
	"DOMICILIO"	TEXT,
	"NUMERO"	TEXT,
	"PISO"	TEXT,
	"DPTO"	TEXT,
	"CODIGOPOSTAL"	TEXT,
	"CIUDAD"	TEXT,
	"COMUNA"	TEXT,
	"REGION"	TEXT,
	"PAIS"	TEXT,
	"OBSERVACIONES"	TEXT,
	"FOTO"	BLOB,
	PRIMARY KEY("RUTID","DIGVER")
);
CREATE TABLE IF NOT EXISTS "RECURSOS" (
	"RUTID"	TEXT,
	"DIGVER"	TEXT,
	"PROPIETARIO"	TEXT,
	"DESCRIPCION"	TEXT,
	"PATENTE"	TEXT,
	"MARCA"	TEXT,
	"MODELO"	TEXT,
	"VARIANTE"	TEXT,
	"ANO"	TEXT,
	"COLOR"	TEXT,
	"CIUDAD"	TEXT,
	"COMUNA"	TEXT,
	"REGION"	TEXT,
	"PAIS"	TEXT,
	"OBSERVACIONES"	TEXT,
	"FOTO"	BLOB,
	PRIMARY KEY("RUTID","DIGVER","PATENTE")
);
CREATE TABLE IF NOT EXISTS "CLIENTES" (
	"RUTID"	TEXT,
	"DIGVER"	TEXT,
	"NOMBRE"	TEXT,
	"ACTIVIDAD1"	TEXT,
	"ACTIVIDAD2"	TEXT,
